import React, { Component } from 'react'

export default class NavBrand extends Component {
    render() {
        return (
            <NavWrapper className="navbar navbar-light bg-light">
                
                    <a className="navbar-brand" href="#">Navbar</a>

            </NavWrapper>

        )
    }
}
